import './App.css';
import uuid from 'react-uuid'
import React, { useState } from 'react';

function App() {
    let [count, setCount] = useState(0);

	function clickHandler() {
		setCount(count + 1);
	}

	return <div>
		<span>{count}</span>
		<button onClick={clickHandler}>+</button>
	</div>;
}

export default App;
